function TitlesArchive() {
  const repTitles = ["Goal", "Add/Remove", "How often?"];
  const titles3col = [
    {
      type: "temporary goals",
      col1: repTitles[0],
      col2: "What has to happen to accomplish it?",
      col3: repTitles[1],
    },
    {
      type: "forbidden activities",
      col1: repTitles[0],
      col2: "Until when?",
      col3: repTitles[1],
    },
  ];
  const titles4col = [
    {
      type: "cont. goals (time dependent)",
      col1: repTitles[0],
      col2: repTitles[2],
      col3: "For how long?",
      col4: repTitles[1],
    },
    {
      type: "cont. goals (action dependent)",
      col1: repTitles[0],
      col2: repTitles[2],
      col3: "Which action?",
      col4: repTitles[1],
    },
    {
      type: "limited activities",
      col1: "Activity",
      col2: repTitles[2],
      col3: "Daily time allowed",
      col4: repTitles[1],
    },
    {
      type: "forbidden activities",
      col1: "Activity",
      col2: "For how long?",
      col3: repTitles[1],
    },
    {
      type: "social gatherings",
      col1: "test",
      col2: "test",
      col3: "test",
      col4: repTitles[1],
    },
  ];
}

export default TitlesArchive;
